import styled from "styled-components";


export const SquareContent = styled.div `
    display: flex;
    justify-content: center;
    align-items: center;
    width: 600px;
    height: 600px;
    border: 1px solid black;
    
    
`

export const Squarelink2 = styled.a`
        text-decoration: none;
        font-size: 18px;
        color: black;

`
